import React from 'react';
import { Routes, Route } from 'react-router-dom';
import Home from './home';
import './App.css';

function App() {
  return (
    <div className="App">
      <Routes>
        <Route path="/blog" element={<Home />} />
      </Routes>
    </div>
  );
}

export default App;
